      description:
        "Our Reusable Liquid Chalk Dry Erase 'Chalkboard' for First and Last Day Of School Photos is the perfect prop to capture your child's important milestones! We offer First Day, Last Day or the Set of Both! This listing features PASTEL colors. \n\nOur PRIMARY Color boards can be found here:\n\nhttps://www.etsy.com/listing/621813362/reusable-first-and-last-day-of-school?ref=listings_manager_grid\n\nIf you choose for us to print the name at the top for you (the rest will be blank for you to fill in) please leave name in the note to seller box on the checkout page.\n\nSign Details:\n\n- 9.5'x12.5' rounded corners liquid chalk dry erase blackboard which mimics a chalkboard\n- Works with any liquid chalk dry erase marker, white or neon colors for non-porous surfaces.\n- Glossy Finish\n- Design is only on one side. \n- Lightweight and Durable. Easy for kids to hold and will last years\n\nCare Instructions:\n\n- Wipe before and after each use with microfiber cloth or non-abrasive material cloth. Do NOT use any cleaning agents to wipe off the board. We recommend wiping clean immediately after use to keep the finish long lasting.\n\nMarker Tips:\n\nMany brands require you to 'prime' the marker before use to get the ink flowing. Some you pump the tip facing up and then pump tip down several times on surface to get ink flowing. Some you can just pump the tip down to get ink flowing. Please follow the markers instructions for best results. If your markers seem to be bubbling up as you are writing, give the board a wipe down with a damp/wet magic eraser and dry with a micro-fiber cloth to help the ink adhere to the boards. If they are still not working, they are not the correct type of marker, or they were not primed correctly. It is not our boards. We have used many different marker brands and every single one works if you prime the marker correctly. \n\nShipping & Policies:\n\nEach order is custom made and we pride ourselves on our products and service!\n\nYour order will be ready to ship in 1-4 business days. Please allow a 2-5 additional business days for delivery from USPS. \n\nPlease make sure your address on file with Etsy is current. Kitty & Bobo's Designs will not be responsible for any outdated or incorrect shipping information provided. \n\n©Kitty & Bobo's Designs",
