      description:
        "Pitcher, Pitcher, Gargoulette in terracotta with water or wine. Spanish pottery handpainted\n\nThis piece was produced in Spain, in the province of Alicante. Painted with traditional Spanish motifs.\n\nHeight: 31 cm - 12,20 '\nBeaker width: 22 cm - 8.66 '\nWeight: 1.7 kg\n\nFor a country or contemporary decoration.\n\nCalled 'Cantir' (Spain) or 'Gargoulette' (France). Although examples were discovered 2,500 years ago, they became more widely used in the 19th century. They are closed containers with a filler neck and a small spout to pour the liquid in a thin stream. Although composed of many different materials, unglazed terracotta was the most common because it allowed evaporation, cooling the liquid by a few degrees.\n\n      ----\n\nAll our products are vintage, so they have traces of time and wear. No products are new.\nPlease look at the pictures and read the description.\n\n      -----\n\nFor beautiful vintage ideas and home accessories, take a look at our shop!\nhttps://www.etsy.com/fr/shop/LeLouisShop?ref=hdr_shop_menu\n\n      -----\n\nEach item is carefully packaged and shipped within 2 days.\nWe make sure your article arrives in the best possible conditions.\n\nIf you want to buy several items at the same time, let us know, and we will recalculate your shipping costs as soon as possible.\n\nFor buyers outside the European Union: Please note that any taxes or customs fees are not included in the purchase price and are the sole responsibility of the buyer.\n\nChristophe and Annabelle",
